import React from "react";

function Square(props) {
    return (
        <div className="grid-container">
            {
                props.characters.map(char => {
                    <div className="grid-item">
                        <img src={`${char}.png`} alt={char} />
                    </div>
                })
            }
        </div>
    );
}

export default Square;
